int done = 0;
int line = 0;

void printHalftoneForPixelLine()
{
    int i, j;
    
    for(i = 0; i < 2; i++)
    {
        for(j = 0; j < WIDTH_2; j++)
        {
            printf("%c", aux[i][j]);
        }
    }
}

void buildMatrixForPixelLine(int category, int col)
{
    switch(category){
        case 0:
            aux[0][2*col]       = 33;
            aux[0][(2*col) + 1] = 33;
            aux[1][2*col]       = 33;
            aux[1][(2*col) + 1] = 33;
            break;
            
        case 1:
            aux[0][2*col]       = 125;
            aux[0][(2*col) + 1] = 33;
            aux[1][2*col]       = 33;
            aux[1][(2*col) + 1] = 33;
            break;
            
        case 2:
            aux[0][2*col]       = 125;
            aux[0][(2*col) + 1] = 33;
            aux[1][2*col]       = 33;
            aux[1][(2*col) + 1] = 125;
            break;
            
        case 3:
            aux[0][2*col]       = 125;
            aux[0][(2*col) + 1] = 125;
            aux[1][2*col]       = 33;
            aux[1][(2*col) + 1] = 125;
            break;
            
        case 4:
            aux[0][2*col]       = 125;
            aux[0][(2*col) + 1] = 125;
            aux[1][2*col]       = 125;
            aux[1][(2*col) + 1] = 125;
            break;
    };
}

void calculaHalftone(int row)
{
    int col;
    unsigned char pixel;
    
    for (col = 0; col < WIDTH; col++)
    {
        pixel = image[row][col];
        
        if (pixel >= 0 && pixel <= 51)
        {
            buildMatrixForPixelLine(0, col);
        }
        else
        {
            if (pixel > 51 && pixel <= 102)
            {
                buildMatrixForPixelLine(1, col);
            }
            else
            {
                if (pixel > 102 && pixel <= 153)
                {
                    buildMatrixForPixelLine(2, col);
                }
                else
                {
                    if (pixel > 153 && pixel < 204)
                    {
                        buildMatrixForPixelLine(3, col);
                    }
                    else
                    {
                        buildMatrixForPixelLine(4, col);
                    }
                }
            }
        }
        
        //printf("processando pixel[0][%d]...\n\r", col);
    }
    
    //printf("Terminei halftone...\n\r");
}

